import React from 'react'
import Stack from '@mui/material/Stack';
import { Typography } from '@mui/material';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Avatar from '@mui/material/Avatar';
import Avatarimg from '../images/avatar.jpg'

const PortfolioBox = ({url,img,title,description,tech}) => {
  return (
    <>

      <a href={url} style={{ textDecoration: 'none' }}>
        <Box 
          sx={{
            backgroundColor:"#FFFFFF",
            boxShadow: 2,
            borderRadius:"16px",
            padding:"24px",
            cursor:"pointer",
            transition: "all 0.2s ease-in-out",
            '&:hover': {
            backgroundColor: "#E5E6E6",
            transform: "scale(1.05)",
        }
          }}>

              <Stack>
                <img src={Avatarimg} alt='profile img'/>
                <Typography sx={{fontSize:"16px",fontFamily:'Inter',fontWeight:"700",color:"#000000"}}>Sejun Park</Typography>
                <Typography sx={{fontSize:"14px",fontFamily:'Inter',fontWeight:"regular",color:"#4B5563"}}>sejunparks@gmail.com</Typography>
                <Typography sx={{fontSize:"14px",fontFamily:'Inter',fontWeight:"regular",color:"#4B5563"}}>647-545-0598</Typography>
              </Stack>



            </Box>
      </a>


    </>
  )
}

export default PortfolioBox
